const HELP_TEXT = "Help Text";

const inputClick = () => console.log("click");
const mouseHover = () => console.log("MOuse");

const elements = (
  <div className="name">
    <h1>{HELP_TEXT}</h1>
    <input
      placeholder={HELP_TEXT}
      onClick={inputClick}
      onMouseEnter={mouseHover}
    />
    <p>{HELP_TEXT === "Help Text" ? "Yes" : "No"}</p>
  </div>
);

const app = document.getElementById("app");
ReactDOMClient.createRoot(elements, app);
